# TODO Problem 1.1: Bubble Sort Function
def bubblesort_k(lst,k):
    swapOccured = True
    # Continues the sorting process as long as at least one swap occured in the previous iteration
    while(swapOccured):
        swapOccured = False
        for i in range(len(lst)-1):
            if lst[i].count < lst[i+1].count:
                # Performs the swap
                temp = lst[i]
                lst[i] = lst[i+1]
                lst[i+1] = temp
                swapOccured = True
    print_passwords(lst[:k])
    return lst[:k]

# TODO Problem 1.2: Quick Sort Function
def quicksort_k(lst, start, end, k):
    if(end-start < 1): # Ends the call if the sublist is too short
        return
    # Finds the pivot and performs the partition
    pivotInd = qsPartition(lst, start, end)

    # Sorts the values on the left side of the pivot
    quicksort_k(lst, start, pivotInd-1, 0)

    # Sorts the vales on the right side of the pivot
    quicksort_k(lst, pivotInd+1, end, 0)

    # Prints the resulting top k passwords after the list has been sorted
    if(k != 0):
        print_passwords(lst[:k])
        return lst[:k]



# TODO Problem 1.3: Quick Sort Search Function
def quickersort_k(lst, start, end, k):
    if(end-start < 1):
        return
    pivotInd = qsPartition(lst, start, end)

    # If sublist of values > pivot, quicker Sort is only run on left sublist
    if(pivotInd-start > k):
        quickersort_k(lst, start, pivotInd - 1, k)
    else:
        quickersort_k(lst, start, pivotInd - 1, k)
        quickersort_k(lst, pivotInd+1, end, k)

    # Prints resulting top k counts of passwords
    if(end-start == len(lst)-1):
        print_passwords(lst[:k])
        return lst[:k]

# Partitioning Method for both quick sort methods
def qsPartition(lst, start, end):
    pivot = lst[start].count # Sets the pivot
    less = end # Sets the pointer for the lesser value
    more = start + 1 # Sets pointer for more value starting after the pivot

    while(more < less):
        # Runs until value at more index is less than pivot or at end of list
        while (more<end+1) and (lst[more].count >= pivot):
            more += 1
        # Runs until value at less index is more than pivot
        while (less > start) and (lst[less].count <= pivot):
            less -= 1
        # Swaps values at more and less indexes
        if more < less:
            temp = lst[less]
            lst[less] = lst[more]
            lst[more] = temp
    # Swaps pivot and less index value if it is greater than the pivot
    if(lst[less].count > pivot):
        temp = lst[less]
        lst[less] = lst[start]
        lst[start] = temp
        # Returns less index to be used as pivot in quickSort/quickerSort function
        return less
    # Returns start index to be used as pivot in quickSort/quickerSort function
    return start

