# TODO: Problem 2.1: Normal solution
def absolute_sort(arr):
    cArr = arr[:] # Creates copy of the orignal array
    for i in range(len(arr)):
        cArr[i] = abs(cArr[i]) # Sets the current element of cArr to its absolute value

        # Compares cArr[i] to other elements in list not yet sorted and swaps accordingly
        for j in range(len(cArr)-1,i,-1):
            if(cArr[j] >= cArr[i]):
                temp = cArr[i]
                cArr[i] = cArr[j]
                cArr[j] = temp
    # Returns sorted absolute value copy of the original array
    return cArr

# TODO: Problem 2.2: O(n) solution
def better_abs_sort(arr):
    cArr = arr[:] # Creates copy of original array
    result = [None] * len(cArr) # Empty result array with same length as cArr

    # Special cases
    if(cArr[0] >= 0 or len(cArr) == 1):
        return cArr[::-1]
    if(cArr[len(cArr)-1] <= 0):
        for i in range(len(cArr)):
            cArr[i] = abs(cArr[i])
        return cArr

    # Regular cases
    index = 0
    # Sets all values < 0 to absolute value and updates the index
    while((index<len(cArr)) and cArr[index] < 0):
        cArr[index] = abs(cArr[index])
        index += 1

    cArrLeft = cArr[:index] # Updated absolute values
    cArrRight = cArr[index:] # Values greater than zero

    # Special case if all values in the left sublist are less than the smallest value in the right sublist
    if(cArrLeft[0] < cArrRight[0]):
        cArrLeft = cArrLeft[::-1]
        result = cArrLeft + cArrRight
        result = result[::-1]
        return result

    cArrRight = cArrRight[::-1]
    j = 0
    leftInd = 0
    rightInd = 0
    for j in range(len(cArr)-1):
        # Adds current value in the left sublist to the result if it is greatest value
        if(leftInd < len(cArrLeft) and rightInd < len(cArrRight) and cArrLeft[leftInd] >= cArrRight[rightInd]):
            result[j] = cArrLeft[leftInd]
            leftInd += 1
        # Adds current value in the right sublist to the result if it is next greatest value
        elif(rightInd < len(cArrRight) and leftInd < len(cArrLeft) and cArrLeft[leftInd] < cArrRight[rightInd]):
            result[j] = cArrRight[rightInd]
            rightInd += 1


    # Adds remaining values from either right or left sublists to result
    if (leftInd < len(cArrLeft)):
        cArrLeft = cArrLeft[leftInd:]
        result = result[:len(result) -len(cArrLeft)] + cArrLeft
    if(rightInd < len(cArrRight)):
        cArrRight = cArrRight[rightInd:]
        cArrRight = cArrRight[::-1]
        result = result[:len(result)-len(cArrRight)] + cArrRight

    # Returns resulting of sorted absolute values
    return result

